function download_dump(){fetch("/download_dump").then(response=>response.blob()).then(blob=>{const url=URL.createObjectURL(blob);let a=document.createElement("a");a.href=url,a.download="statistics.db",document.body.appendChild(a),a.click(),document.body.removeChild(a)})}document.addEventListener("DOMContentLoaded",(function(){const btn=document.getElementById("show-btn-id");let project_info_block;document.getElementById("project-info-id").style.display="none",btn.addEventListener("click",(function(){let project_info_block=document.getElementById("project-info-id");"none"===project_info_block.style.display?project_info_block.style.display="block":project_info_block.style.display="none"}));const close_btn=document.getElementById("close-btn");close_btn.addEventListener("click",(function(){let project_info_block;document.getElementById("project-info-id").style.display="none"}));const list_of_select=document.getElementById("list-of");0!=list_of_select.selectedIndex&&fetch("/process/gov-ca").then(response=>response.text()).then(data=>{textarea.value=data}).catch(error=>console.error(error)),list_of_select.selectedIndex=0;const select=document.getElementById("list-of"),textarea=document.getElementById("site-list");select.addEventListener("change",event=>{const selectedValue=event.target.value,url=`/process/${selectedValue}`;fetch(url).then(response=>response.text()).then(data=>{textarea.value=data}).catch(error=>console.error(error))})}));